import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      title: "Cloud Platforms",
      skills: ["AWS", "EC2", "S3", "RDS", "Lambda", "CloudWatch", "Cost Optimization"]
    },
    {
      title: "Infrastructure as Code",
      skills: ["Terraform", "CloudFormation", "Ansible", "Helm Charts"]
    },
    {
      title: "Containerization & Orchestration",
      skills: ["Docker", "ECS", "ECR", "Container Security", "Multi-container Apps"]
    },
    {
      title: "CI/CD & DevOps",
      skills: ["GitHub Actions", "Jenkins", "GitLab CI", "Pipeline Automation", "Deployment Strategies"]
    },
    {
      title: "Monitoring & Observability",
      skills: ["Dynatrace", "Prometheus", "Grafana", "ELK Stack", "CloudWatch"]
    },
    {
      title: "Database Management",
      skills: ["AWS RDS", "On-Premise SQL", "MySQL", "Database Migration", "Tableau"]
    },
    {
      title: "Scripting & Programming",
      skills: ["Python", "Bash", "PowerShell", "YAML", "Terraform HCL", "TypeScript"]
    },
    {
      title: "Security & Patch Management",
      skills: ["IAM", "Security Groups", "Sysxense", "SSM", "Cross-Account Management", "Automated Patching"]
    },
    {
      title: "Web Platform Management",
      skills: ["WordPress Multisite", "LAMP Stack", "Site Migration", "Content Management"]
    }
  ];

  return (
    <section id="skills" className="skills">
      <div className="container">
        <h2>Technical Expertise</h2>
        <div className="skills-grid">
          {skillCategories.map((category, index) => (
            <div key={index} className="skill-category">
              <h3>{category.title}</h3>
              <ul className="skill-list">
                {category.skills.map((skill, skillIndex) => (
                  <li key={skillIndex} className="skill-item">{skill}</li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
